const _hoisted_7 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>True Name: Mysterious Heroine X</li><li>Class: Assassin (insists she is a Saber)</li><li>Source: 2013 April Fools\u2019</li><li>Region: Servant World</li><li>Gender: Female</li><li>Alignment: Chaotic Good</li><li>Height: 154cm</li><li>Weight: 42kg</li></ul><p><strong>Meta</strong></p><ul><li>Character Creator: Kinoko Nasu</li><li>Original Character Design: Takashi Takeuchi</li><li>Character Illustrator: BUNBUN</li><li>Character Voice: Ayako Kawasumi</li><li>Appearance in Main Works: Back Alley Satsuki \u2013 12 Heroines Sanctuary Arc, Fate/Grand Order</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">A+</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">A++</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Cosmo Reactor: [A]</strong></p><p>A reactor that\u2019s cosmic, it\u2019s allowed only to the shining Saber.<br> The reactor reacts to many things. Like the plot, for example.</p><p><strong>Riding: [EX]</strong></p><p>Talent for riding. She can\u2019t manage most mounts and vehicles, but she is amazingly effective when it comes to piloting junk spaceships. To the point that she can make a ship with no warp function warp.</p><p><strong>Presence Concealment: [-]</strong></p><p>Are you implying Sabers have that!?<br> (It\u2019s actually ranked EX, but it\u2019s sealed since she completely denies it)</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Back-up Fire: [EX]</strong></p><p>Using a mysterious communication device, she can have Du Stallion II automatically perform back-up fire.<br> In a duel between knights, there\u2019s no such thing as dirty trucks and underhanded tictacs.</p><p><strong>Instinct: [C+]</strong></p><p>Considerably downgraded compared to the normal Arthuria, but it ranks itself up to A-Rank Instinct for anti-Saber purposes only.</p><p><strong>Galactic Meteor Sword: [C]</strong></p><p>A power given to Saber that can destroy even stars.<br> Also known as the sword that absolutely kills Sabers.<br> Since it\u2019s super-effective against Sabers, wouldn\u2019t you agree that this makes her the greatest Saber of all?</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="himitsucalibur-nameless-victory-sword" tabindex="-1"><a class="header-anchor" href="#himitsucalibur-nameless-victory-sword" aria-hidden="true">#</a> Himitsucalibur (Nameless Victory Sword)</h1><ul><li>Rank: A+</li><li>Type: Anti-Unit</li><li>Range: 1-99</li><li>Max. Targets: 1 person</li></ul><p>Holy swords that boast a tremendous power against Sabers.<br> They don\u2019t launch beams, but they are covered in them. Also, they make this neat low-register woooooom woooooooom sound every time she swings them.<br> \u2026 Hey, I\u2019m sure I\u2019ve heard that somewhere before.<br> Dual-wielding swords of opposite attributes requires a tremendous power management. That goes to show how out of the ordinary Heroine X is.<br> It even seems like light and darkness are strongest when they mingle.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><p>First person pronoun: watashi<br> Second person pronoun: anata/ omae<br> Third person pronoun: kare/ kanojo</p><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>A personality like Arthuria-san but without any of the seriousness.<br> She is overly serious, driven, and absolutely unforgiving of evil.<br> Because she also got a boost to her quick temper, she was turned into the foolhardy chairman type of character. This honesty makes her easily deceived.<br> She exceedingly loves, hates, and grieves over Sabers.<br> She\u2019s adamant that she is the only Saber the world needs and makes a point that some underhanded trickery is necessary for that purpose, but due to her innate goodness, she is less than successful with this. No matter how she spins it, she can\u2019t turn into a villain.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>\u201CI pray that all Sabers besides me perish.<br> Another desirable option is that they stop calling themselves Sabers and get some other classification, like maybe Attacker or Swordsman.\u201D</p><p>As her base is still who she is, she will never have a bad attitude towards her Master.<br> However, given the opportunity, she will try to unlock the Sabers other than herself.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>\u201CDie, Sabers other than me.\u201D</p><p>\u201CNo one becomes a Saber overnight! Remember to sleep early, wake up, always eat all of your vegetables, and take breaks whenever necessary!\u201D</p><p>\u201CLook, Master, this is my new form! Defeating the Arthuria-type Sabers is now something too small and meaningless for me to mention! My new objective is to become the strongest Saber to be of use to you!\u201D</p><h2 id="character-image" tabindex="-1"><a class="header-anchor" href="#character-image" aria-hidden="true">#</a> Character Image</h2><p>It all begins with Mysterious Heroine X appearing for April Fool\u2019s in April 1st, 2013.<br> The blue scarf, the hat, the ahoge piercing through it, the visibly dangerous adorned holy sword.<br> Her true identity is Arthuria Pendragon.<br> The most notorious Main Heroine\u2026 she was supposed to be. Feeling threatened by rise of Red Saber and Black Saber, she swore to eradicate all Sabers!<br> Going by that logic, her Class was set as Assassin.</p><p>She works as a Main Heroine in a newly introduced mysterious world, the Servant Universe.<br> Since evil Servants can go as wild as they want, American-style, on parallel worlds in the Servant Universe, the Mysterious Heroine X hides her identity with her hat and scarf and fiercely fights night and day against the world destruction-scheming Captain\u2606Nikola.<br> Also, since this world has a condition where the Villain Servants don\u2019t die, they are only sent to jail, from where they can escape whenever they want to joyfully and cheerfully go back to doing their evil works.<br> Sometimes they do die, are killed, make someone die, switch to the heroes\u2019 side or become zombies.<br> It\u2019s a nonsense land where all characters of all worlds are bound to hero/villain character roles that get reset when they go back to their home place, making their character development start back from scratch.</p><p>In Fate/Grand Order, the number of Sabers increased exponentially.<br> She says this increasingly fills her with desire to kill and that they are enemies worthy of her holy sword or some crap like that.</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>The Saber Class</strong></p><p>Sabertei Must Be Destroyed.</p><p><strong>Arthuria Lily</strong></p><p>Too soft! (No self-awareness about her own softness)</p><p><strong>Mysterious Sailor X</strong></p><p>\u2026 Huh? Who are you? Someone from Episode II perhaps?</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>She was a character from one of Type-Moon-san\u2019s April Fools\u2019 projects and one I always loved, so I gladly accepted the job, but her design was already complete, so when it came to make alternate designs, whenever I put something in or took something out, it felt wrong\u2026 My only option was to think outside of the box, ready to be scolded for it\u2026 and so I sent that final form and got the OK against my expectation. But in the end\u2026 who even is she\u2026? (sophisticated beauty) (BUNBUN)</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p>(Lib will add after publish)</p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 54);
